import * as React from 'react';
import './CardNews.css';
import {getUsers} from '../../../services/api_services';
import { ReactElement } from 'react';
import { IUser } from '../../../interfaces/IUser';

export interface ICardNewsProps {

}

export default class CardNews extends React.Component<ICardNewsProps> {


  public render() {

    const elementUsers : Array<ReactElement> = new Array;

    getUsers().forEach((e: IUser) => { 
      elementUsers.push( <div className='card mx-4 p-1 mt-2'>
                          <div className='card-body row text-start p-0 '>
                            <div className='col-9 py-2 px-4'>
                              <strong> Cadastro Novo usuario,</strong>
                              <div>Nome: {e.name} | Telefone: {e.phone} | Conta: {e.account.id} </div>
                            </div>
                            <div className='col-3 py-1 px-4 text-end align-items-stretch'>
                              <div className='date-time'> 11:25 - 21/5/52 </div>
                              <div className='pt-2'>icons</div>
                            </div>
                          </div>
                        </div>) 
    })

    return (
      <div className='card col py-4 m-2 bg-white teste card-news'>
          <div className=" card-title text-start px-4">
            <h5>Novidades</h5>
            <hr />
          </div>
          {elementUsers}
      </div>
    );
  }
}
